import React from 'react';
import helpPhoto from '../images/Group 46.png'; // Import the help photo
import dashboardImage from '../images/moptro logo.jpg'; // Import the dashboard image

const Home = () => {
  return (
    <div>
      <img src={helpPhoto} alt="Help" style={{ position: 'absolute', top: '20px', left: '20px' }} />
      <img src={dashboardImage} alt="Dashboard" style={{ width: '100%', height: 'auto' }} />

      <div style={{ position: 'absolute', top: '50%', left: '50%', transform: 'translate(-50%, -50%)', textAlign: 'center', width: '80%', backgroundColor: '#f9f9f9', padding: '20px', borderRadius: '10px' }}>
        <h2>Employee Productivity Dashboard</h2>
        <div style={{ marginBottom: '20px' }}>
          Productivity on Monday:
          <div style={{ width: '100%', backgroundColor: '#ddd', borderRadius: '5px', height: '20px', marginTop: '5px' }}>
            <div style={{ width: '4%', backgroundColor: 'green', borderRadius: '5px', height: '100%' }}></div>
          </div>
          <span style={{ marginLeft: '10px' }}>4%</span>
        </div>
        {/* Repeat the above structure for each day of the week */}
      </div>
    </div>
  );
}

export default Home;
